int printable(int n)
{
	if (n > 32 && n < 127 && !(n==34||n==39||n==92))
		return 1;
	return 0; 
}

void set_int_type(char *suf, MTYPE *m)
{
	char *u = "uU";
	if (strpbrk(suf, u))
		m->is_signed = 0;
	else
		m->is_signed = 1;
	// we can only have L or LL (or l or ll) left...
	int lcount = strlen(suf) + (m->is_signed) - 1;
	if (lcount == 2)
		m->num_type = longlong_type;
	else if (lcount == 1)
		m->num_type = long_type;
	else if (lcount == 0)
		m->num_type = int_type;
	else
		m->num_type = "SHIT";
	return;
}

void set_double_type(char *suf, MTYPE *m)
{
	if (!strlen(suf))
	{
		m->num_type = double_type;
		return;
	}
	char s = suf[0];
	if (s == 'l' || s == 'L')
	{
		m->num_type = longdouble_type;
		return;
	}
	m->num_type = float_type;
	return;

}

void printchar(FILE *f, int charcode)
{ 
    if (printable(charcode)) 
    { 
        fprintf(f, "%c", charcode); 
		return;
    }    
    switch (charcode) 
    { 
        case 7: 
            fprintf(f, "\\a"); break;
        case 8: 
            fprintf(f, "\\b"); break;
        case 12: 
            fprintf(f, "\\f"); break;
        case 10: 
            fprintf(f, "\\n"); break;
        case 13: 
            fprintf(f, "\\r"); break;
        case 9: 
            fprintf(f, "\\t"); break;
        case 11: 
            fprintf(f, "\\v"); break;
        case 0: 
            fprintf(f, "\\0"); break;
        case 34: 
            fprintf(f, "\\\""); break;
        case 39: 
            fprintf(f, "\\\'"); break;
        case 92: 
            fprintf(f, "\\\\"); break;
        default: 
            fprintf(f, "\\%03o", charcode); 
    } 
    return; 
}


